import React from 'react';
import { GlobalStyle, WeatherCard, Code, BreakLine, Subtitle } from '../../styles/styles';
import { findLanguageByKey } from '../../languages/Languages';
const SocialNetwork = ({ actualLanguage }) => {
	const fullLanguage = findLanguageByKey(actualLanguage);
	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				<code>{fullLanguage}</code>
			</WeatherCard>
		</>
	);
};

export default SocialNetwork;
